import Sequelize from "sequelize";
import config from '../../config/config'

const sequelize = new Sequelize(
  config.db_name,
  config.db_username,
  config.db_pasword,
  {
    dialect: 'postgres',
    pool: {
      max: 5,
      min: 0,
      acquire: 30000,
      idle: 10000
    }
  }
)

const DataTypes = require("sequelize").DataTypes;
const _hotel = require("./hotel");
const _room = require("./room");
const _users = require("./users");

function initModels(sequelize) {
  const hotel = _hotel(sequelize, DataTypes);
  const room = _room(sequelize, DataTypes);
  const users = _users(sequelize, DataTypes);

  room.belongsTo(hotel, { as: "hotel", foreignKey: "hotel_id" });
  hotel.hasMany(room, { as: "rooms", foreignKey: "hotel_id" });

  return {
    hotel,
    room,
    users,
  };
}
// module.exports = initModels;
// module.exports.initModels = initModels;
// module.exports.default = initModels;

const models = initModels(sequelize);
export default models
export { sequelize }

