import { Router } from "express";
import indexCtrl from "../controller/indexCtrl";
import uploadDownload from "../../middleware/uploadDownload";

const router = Router()

router.get('/', indexCtrl.HotelCtrl.findAll) //nampilin seluruh data
router.post('/', uploadDownload.uploadFiles, indexCtrl.HotelCtrl.create) //tambah data + foto
router.get('/file/:filename', uploadDownload.showFile) //nampilin foto
router.get('/:id', indexCtrl.HotelCtrl.findOne) //nampilin data berdsarkan id
router.put('/:id', uploadDownload.uploadFiles, indexCtrl.HotelCtrl.update)  //edit data
router.delete('/:id', indexCtrl.HotelCtrl.deleted)  //hapus data

export default router

